import React from "react";
import 'button.scss'

export default function Button({type, name, disable}) {
    return (
        <div>
            <button className="button" type={!!type ? type : 'submit'} disabled={disable}>{!!name ? name : 'Submit'}</button>
        </div>
    )
}
